  return (
    <div className="App">
      <Router>
          <Main path="/pirates"/>
          <Create path="/pirate/new" />
          <Display path="/pirate/:id" />
          {/* <Redirect from="/" to="/pirates" noThrow /> */}
      </Router>
    </div>
  );
}

export default App;
